import React, {Component} from 'react';
import Plot from 'react-plotly.js';
import { neighborhood, percent_overdue } from './data/overdue_percent.js'
import {neighborhood_for_time, neighborhood_mean } from './data/response_time.js'

class App extends React.Component {
  render() {
    return (
      <div>
      <Plot
        data={[
  {
    x: neighborhood,
    y: percent_overdue,
    type: 'bar'
  }
]}
        layout={ {width: 1000, height: 500, title: 'A Fancy Plot', xaxis:{
    title: 'AXIS TITLE'},titlefont: {
      family: 'Arial, sans-serif',
      size: 18,
      color: 'lightgrey'
    },
    showticklabels: true,
    tickangle: 'auto',
    tickfont: {
      family: 'Old Standard TT, serif',
      size: 14,
      color: 'black'
    },
    exponentformat: 'e',
    showexponent: 'all' }}
      />,
    <Plot
        data={[
  {
    x: neighborhood_for_time,
    y: neighborhood_mean,
    type: 'bar'
  }
]}
        layout={ {width: 1000, height: 500, title: 'A Fancy Plot'} }
      />
      <h2> Let's see where this text ends up </h2>
      </div>
    );
  }
}


export default App;
